import React, { useState } from 'react';

const Home = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [newOffer, setNewOffer] = useState({ title: '', location: '', date: '' });

  const handleAddOffer = () => {
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewOffer({ ...newOffer, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ici, vous pouvez ajouter la logique pour sauvegarder la nouvelle offre
    console.log('Nouvelle offre:', newOffer);
    setIsModalOpen(false);
  };

  const styles = {
    homeContainer: {
      fontFamily: 'Arial, sans-serif',
      padding: '20px',
      maxWidth: '800px',
      margin: '0 auto',
    },
    heading: {
      color: '#333',
      textAlign: 'center',
    },
    jobListing: {
      backgroundColor: '#f9f9f9',
      borderLeft: '5px solid #007bff',
      margin: '20px 0',
      padding: '15px',
      borderRadius: '5px',
    },
    jobTitle: {
      color: '#007bff',
      marginTop: '0',
    },
    jobDetail: {
      color: '#666',
      lineHeight: '1.6',
    },
    addButton: {
      backgroundColor: '#007bff',
      color: '#fff',
      border: 'none',
      padding: '10px 20px',
      borderRadius: '5px',
      cursor: 'pointer',
      marginBottom: '20px',
    },
    modalOverlay: {
      position: 'fixed',
      top: '0',
      left: '0',
      width: '100%',
      height: '100%',
      backgroundColor: 'rgba(0, 0, 0, 0.5)',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    },
    modalContent: {
      backgroundColor: '#fff',
      padding: '20px',
      borderRadius: '5px',
      width: '300px',
    },
    modalInput: {
      width: '100%',
      padding: '10px',
      margin: '10px 0',
      borderRadius: '5px',
      border: '1px solid #ccc',
    },
    modalButton: {
      backgroundColor: '#007bff',
      color: '#fff',
      border: 'none',
      padding: '10px 20px',
      borderRadius: '5px',
      cursor: 'pointer',
      marginRight: '10px',
    },
  };

  return (
    <div style={styles.homeContainer}>
      <h1 style={styles.heading}>Postes Ã  pourvoir actuellement</h1>
      <button style={styles.addButton} onClick={handleAddOffer}>Ajouter une offre</button>

      <div style={styles.jobListing}>
        <h2 style={styles.jobTitle}>Chef de Produit Marketing Junior</h2>
        <p style={styles.jobDetail}><strong>Lieu:</strong> Tunisie</p>
        <p style={styles.jobDetail}><strong>Date:</strong> 06/05/2023</p>
      </div>

      {/* Ajoutez les autres offres ici */}

      {isModalOpen && (
        <div style={styles.modalOverlay}>
          <div style={styles.modalContent}>
            <h2>Ajouter une nouvelle offre</h2>
            <form onSubmit={handleSubmit}>
              <input
                type="text"
                name="title"
                placeholder="Titre de l'offre"
                style={styles.modalInput}
                onChange={handleInputChange}
              />
              <input
                type="text"
                name="location"
                placeholder="Lieu"
                style={styles.modalInput}
                onChange={handleInputChange}
              />
              <input
                type="text"
                name="date"
                placeholder="Date"
                style={styles.modalInput}
                onChange={handleInputChange}
              />
              <button type="submit" style={styles.modalButton}>Ajouter</button>
              <button type="button" style={styles.modalButton} onClick={handleCloseModal}>Annuler</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Home;
